import styled from "styled-components";

export const Wrapper = styled.div `
	{	
        height: 100vh;
        width: 100vw;
		background-color: #3776ab;

	}
`

export const Content = styled.div `
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 100%;
    background-color: #3776ab;
    float: left;
    @media screen and (max-width: 550px) {
        {
            width: 100%;
            height: 100%;
        }
      }
`;




